import React from 'react';
import { Card, Button, CardHeader, CardBody,CardImg,
  CardTitle, CardText,Label,
  Row, Col } from 'reactstrap';
// Import actions
// Import settings
import infoImage1 from 'assets/images/exercise/info.png';
import Image1_1 from 'assets/images/exercise/fitness_program/1_1.png';
import Image1_2 from 'assets/images/exercise/fitness_program/1_2.png';
import Image1_3 from 'assets/images/exercise/fitness_program/1_3.png';
import Image1_4 from 'assets/images/exercise/fitness_program/1_4.png';
import Image1_5 from 'assets/images/exercise/fitness_program/1_5.png';
import Image2_1 from 'assets/images/exercise/fitness_program/2_1.png';
import Image2_2 from 'assets/images/exercise/fitness_program/2_2.png';
import Image2_3 from 'assets/images/exercise/fitness_program/2_3.png';
import Image2_4 from 'assets/images/exercise/fitness_program/2_4.png';
import Image2_5 from 'assets/images/exercise/fitness_program/2_5.png';
import Image3_1 from 'assets/images/exercise/fitness_program/3_1.png';
import Image3_2 from 'assets/images/exercise/fitness_program/3_2.png';
import Image3_3 from 'assets/images/exercise/fitness_program/3_3.png';
import Image3_4 from 'assets/images/exercise/fitness_program/3_4.png';
import Image3_5 from 'assets/images/exercise/fitness_program/3_5.png';
import Image4_1 from 'assets/images/exercise/fitness_program/4_1.png';
import Image4_2 from 'assets/images/exercise/fitness_program/4_2.png';
import Image4_3 from 'assets/images/exercise/fitness_program/4_3.png';
import Image4_4 from 'assets/images/exercise/fitness_program/4_4.png';
import '../../categories.css';
class List extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    const oneDay = [
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image1_1,
      },
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image1_2,
      },
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image1_3,
      },
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image1_4,
      },
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image1_5,
      }
    ];
    //-------
    const twoDay = [
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image2_1,
      },
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image2_2,
      },
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image2_3,
      },
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image2_4,
      },
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image2_5,
      }
    ];
    //-------
    const threeDay = [
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image3_1,
      },
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image3_2,
      },
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image3_3,
      },
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image3_4,
      },
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image3_5,
      }
    ];
    //-------
    const fourDay = [
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image4_1,
      },
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image4_2,
      },
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image4_3,
      },
      {
        title: 'Vulputate Mollis Ultricies Fermentum Parturient',
        image:  Image4_4,
      }
    ];
    //-------
    return (
      <div>
          <div  style = {{background: `linear-gradient(transparent, rgba(0, 0, 0, 0.9)), url('${infoImage1}') no-repeat `,backgroundSize:"cover", height:"400px",display:"flex", alignItems:"center"}}>
            <h2 style = {{color:"white", margin:"20px"}}>
            This comprehensive plan will help you lose weight, build shapely muscle, and take your health and energy where they've never been. Start at your level, let Jamie's daily videos guide you, and watch your body transform!
            </h2>
          </div>
          <br/>
        <Card>
          <CardHeader>Day 1</CardHeader>
          <CardBody>
            <Row>
              {
                 oneDay.map((item, index) =>(
                  <Col xs = {2} key = {index}>
                      <Card>
                          <CardImg top width="100%" src={item.image} alt="Card image cap" />
                          <CardBody>
                              <CardTitle>{item.title}</CardTitle>
                          </CardBody>
                      </Card>
                  </Col>
                 ))
              }
            </Row>
          </CardBody>
      </Card>
      <br/>
      <Card>
          <CardHeader>Day 2</CardHeader>
          <CardBody>
            <Row>
            {
                 twoDay.map((item, index) =>(
                  <Col xs = {2} key = {index}>
                      <Card>
                          <CardImg top width="100%" src={item.image} alt="Card image cap" />
                          <CardBody>
                              <CardTitle>{item.title}</CardTitle>
                          </CardBody>
                      </Card>
                  </Col>
                 ))
              }
            </Row>
          </CardBody>
      </Card>
      <br/>
      <Card>
          <CardHeader>Day 3</CardHeader>
          <CardBody>
            <Row>
            {
                 threeDay.map((item, index) =>(
                  <Col xs = {2} key = {index}>
                      <Card>
                          <CardImg top width="100%" src={item.image} alt="Card image cap" />
                          <CardBody>
                              <CardTitle>{item.title}</CardTitle>
                          </CardBody>
                      </Card>
                  </Col>
                 ))
              }
            </Row>
          </CardBody>
      </Card>
       <Card>
       <CardHeader>Day 4</CardHeader>
       <CardBody>
         <Row>
         {
                 fourDay.map((item, index) =>(
                  <Col xs = {2} key = {index}>
                      <Card>
                          <CardImg top width="100%" src={item.image} alt="Card image cap" />
                          <CardBody>
                              <CardTitle>{item.title}</CardTitle>
                          </CardBody>
                      </Card>
                  </Col>
                 ))
              }
         </Row>
       </CardBody>
   </Card>
   </div>
    );
  }
}


export default List;
